import React from "react";
import { Link } from "react-router-dom";
import "./Header.css";
const Header = () => {

  let linkStyle = { textDecoration : none, };
  return (
    <div className="title-container">
      <div className="users-title">
        <h5>Users</h5>
      </div>
      <div className="header-horizontal-line"></div>
      <div className="posts-title" style={{linkStyle}}>
            <Link to="/posts">
              <h5>Posts</h5>
            </Link>
      </div>
      <div className="todos-title" style={{linkStyle}}>
      <Link to="/todos" >
              <h5>Todos</h5>
            </Link>
      </div>

    </div>
  );
};

export default Header;
